ce tu código HTML de verificación o ID de Yandex. Aprende cómo conseguirlo aquí: %s','Yandex Verification ID'=>'ID de verificación de Yandex','Enter your Baidu Webmaster Tools verification HTML code or ID. Learn how to get it: %s'=>'Introduce tu código HTML de verificación o ID de las herramientas para Webmaster de Baidu. Aprende cómo conseguirlo aquí: %s','Baidu Webmaster Tools'=>'Baidu Webmaster Tools','Bing Webmaster Verification Page'=>'Página de verificación de Bing Webmaster','Enter your Bing Webmaster Tools verification HTML code or ID. Get it here: %s'=>'Introduce tu código HTML de verificación o ID de las herramientas para webmasters de Bing. Consíguelo aquí: %s','Bing Webmaster Tools'=>'Bing Webmaster Tools','Search Console Verification Page'=>'Página de verificación de la Search Console','Enter your Google Search Console verification HTML code or ID. Learn how to get it: %s'=>'Introduce tu código HTML de verificación o ID de la Search Console de Google. Aprende cómo conseguirlo aquí: %s','Google Search Console'=>'Search Console de Google','Featured image of the article.'=>'Imagen destacada del artículo.','A link to your site, with your site\'s name and description as anchor text.'=>'Un enlace a tu sitio, con el nombre de tu sitio y descripción como texto ancla.','A link to your site, with your site\'s name as anchor text.'=>'Un enlace a tu sitio, con el nombre del mismo como texto ancla.','A link to the post, with the title as anchor text.'=>'Un enlace a la publicación, con el título como texto ancla.','A link to the archive for the post author, with the authors name as anchor text.'=>'Un enlace al archivo para el autor de la publicación, con el nombre del autor como texto ancla.','Variable'=>'Variable','Available variables'=>'Variables disponibles','Contents are locked because a robots.txt file is present in the root folder.'=>'Los contenidos están bloqueados porque el archivo «robots.txt» está presente en la carpeta raíz.','Add content after each post in your site feeds.'=>'Añadir contenido después de cada publicación en los feeds de tu sitio.','RSS After Content'=>'Después del contenido del RSS','Add content before each post in your site feeds.'=>'Añadir contenido antes de cada publicación en los feeds de tu sitio.','RSS Before Content'=>'Antes del contenido del RSS','Usage Tracking'=>'Seguimiento de uso','Automatically add <code>target="_blank"</code> attribute for external links appearing in your posts, pages, and other post types to make them open in a new browser tab or window. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'Añadir automáticamente el atributo <code>target="_blank"</code> a los enlaces externos que aparezcan en tus entradas, páginas y otros tipos de contenido para que se abran en una nueva pestaña o ventada del navegador. El atributo se aplica dinámicamente cuando se muestra el contenido, el contenido almacenado no se modifica.','The <code>nofollow</code> attribute <strong>will not be added</strong> for the link if target domain is in this list. Add one per line.'=>'El atributo <code>nofollow</code> <strong>no se añadirá</strong> al enlace si el dominio de destino se encuentra en esta lista. Añade uno por línea.','Nofollow Exclude Domains'=>'Dominios excluidos de nofollow','Only add <code>nofollow</code> attribute for the link if target domain is in this list. Add one per line. Leave empty to apply nofollow for <strong>ALL</strong> external domains.'=>'Solo añade el atributo <code>nofollow</code> al enlace si el dominio de destino se encuentra en esta lista. Añade uno por línea. Déjalo vacío para aplicar nofollow a <strong>TODOS</strong> los dominios externos.','Nofollow Domains'=>'Dominios nofollow','Redirect attachments without a parent post to this URL. Leave empty for no redirection.'=>'Redireccionar los adjuntos sin un contenido superior a esta URL. Déjalo vacío para no redireccionar.','Redirect all attachment page URLs to the post they appear in. For more advanced redirection control, use the built-in %s.'=>'Redireccionar todas las URL de páginas de adjuntos a la publicación en la que aparecen. Para un control de redireccionamiento más avanzado, usa el %s integrado.','Redirect Attachments'=>'Redireccionar adjuntos','Please enable Redirections module.'=>'Por favor, activa el módulo de redirecciones.','Redirections Manager'=>'Gestor de redirecciones','Redirection Manager'=>'Gestor de redirecciones','Why do this?'=>'¿Por qué hacer esto?','Remove /category/ from category archive URLs. %s <br>E.g. <code>example.com/category/my-category/</code> becomes <code>example.com/my-category</code>'=>'Elimina /category/ de las URL de los archivos de categoría. %s <br>P.ej: <code>ejemplo.com/category/mi-categoria/</code> se convierte en <code>ejemplo.com/mi-categoria/</code>','Format used for the new <code>title</code> attribute values.'=>'Formato usado para los nuevos valores del atributo <code>title</code>.','Title attribute format'=>'Formato del atributo del título','Add <code>TITLE</code> attribute for all <code>images</code> without a <code>TITLE</code> attribute automatically. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'Añade el atributo <code>TITLE</code> automáticamente a todas las <code>imágenes</code> sin el atributo <code>TITLE</code>. El atributo se aplica dinámicamente cuando se muestra el contenido, el contenido guardado no se modifica.','Add missing TITLE attributes'=>'Añade los atributos TITLE que faltan','Format used for the new <code>alt</code> attribute values.'=>'Formato usado para los nuevos valores del atributo <code>alt</code>.','Alt attribute format'=>'Formato del atributo alt','Add <code>alt</code> attributes for <code>images</code> without <code>alt</code> attributes automatically. The attribute is dynamically applied when the content is displayed, and the stored content is not changed.'=>'Añadir el atributo <code>alt</code> automáticamente a todas las <code>imágenes</code> sin el atributo <code>alt</code>. El atributo se aplica dinámicamente cuando se muestra el contenido, el contenido guardado no se modifica.','Be careful when editing the htaccess file, it is easy to make mistakes and break your site. If that happens, you can restore the file to its state <strong>before the last edit</strong> by replacing the htaccess file with the backup copy created by Rank Math in the same directory (<em>.htaccess_back_xxxxxx</em>) using an FTP client.'=>'Ten cuidado cuando edites el archivo htaccess, es fácil cometer errores y romper tu sitio. Si eso ocurriese, puedes restaurar el archivo a su estado <strong>anterior a la última edición</strong> reemplazando el archivo htaccess por la copia de seguridad creada por Rank Math en el mismo directorio (<em>.htaccess_back_xxxxxx</em>) usando un cliente FTP.','I understand the risks and I want to edit the file'=>'Comprendo los riesgos y quiero editar el archivo','.htaccess file is not writable.'=>'El archivo «.htaccess» no tiene permisos de escritura.','.htaccess file not found.'=>'No se encuentra el archivo .htaccess','Hide Taxonomy Name from Breadcrumb.'=>'Ocultar el nombre de la taxonomía de la miga de pan.','Hide Taxonomy Name'=>'Ocultar el nombre de la taxonomía','If category is a child category, show all ancestor categories.'=>'Si la categoría es una categoría hija, mostrar todas las categorías anteriores.','Show Category(s)'=>'Mostrar categoría(s)','Hide Post title from Breadcrumb.'=>'Ocultar el título de la publicación de la miga de pan.','Hide Post Title'=>'Ocultar título de la publicación.','Label used for 404 error item in breadcrumbs.'=>'Etiqueta usada para el elemento de error 404 en las migas de pan.','404 label'=>'Etiqueta 404','Format the label used for search results pages.'=>'Dar formato a la etiqueta usada en las páginas de resultados de búsqueda.','Search Results Format'=>'Formato de los resultados de búsqueda','Format the label used for archive pages.'=>'Dar formato la etiqueta usada para las páginas de archivo.','Archive Format'=>'Formato del archivo','Prefix for the breadcrumb path.'=>'Prefijo para la ruta de las migas de pan.','Prefix Breadcrumb'=>'Prefijo de las migas de pan','Label used for homepage link (first item) in breadcrumbs.'=>'Etiqueta usada para el enlace a la página de inicio (primer elemento) en las migas de pan.','Homepage label'=>'Etiqueta de la página de inicio','Display homepage breadcrumb in trail.'=>'Mostrar la miga de pan de la página de inicio en la ruta.','Show Homepage Link'=>'Mostrar enlace a la página de inicio','Separator character or string that appears between breadcrumb items.'=>'Carácter separador o cadena que se muestra entre cada elemento de las migas de pan.','Turning off breadcrumbs will hide breadcrumbs inserted in template files too.'=>'Desactivando las migas de pan también se ocultarán las migas de pan que contienen los archivos de la plantilla.','Enable breadcrumbs function'=>'Activar la función de las migas de pan','Remove WooCommerce generator tag from the source code.'=>'Eliminar la etiqueta del generador de WooCommerce del código fuente.','Remove Generator Tag'=>'Eliminar etiqueta del generador','default: /product-category/accessories/action-figures/ - changed: /product-category/action-figures/'=>'por defecto: /categoria-producto/accesorios/figuras-de-accion/ - modificado: /categoria-producto/figuras-de-accion/','Remove parent slugs from category URL.'=>'Eliminar los slugs superiores de la URL de la categoría.',' Remove parent slugs'=>'Eliminar slugs superiores','default: /product-category/accessories/action-figures/ - changed: /accessories/action-figures/'=>'por defecto: /categoria-producto/accesorios/figuras-de-accion/ - modificado: /accesorios/figuras-de-accion/','Remove prefix from category URL.'=>'Eliminar prefijo de la URL de la categoría.','Remove category base'=>'Eliminar categoría base','Remove base'=>'Eliminar base','Product\'s brand of the current product'=>'Marca del producto actual','Product\'s brand.'=>'Marca del producto.','Product\'s short description of the current product'=>'Descripción corta del producto actual','Product\'s short description.'=>'Descripción corta del producto.','Product\'s SKU of the current product'=>'SKU del producto actual','Product\'s SKU.'=>'SKU del producto.','Product\'s price of the current product'=>'Precio del producto actual','Product\'s price.'=>'Precio del producto.','Include archive pages of terms that have no posts associated.'=>'Incluir páginas de archivo de términos que no tienen publicaciones asociadas.','Include Empty Terms'=>'Incluir términos vacíos','Include archive pages for terms of this taxonomy in the XML sitemap.'=>'Incluir páginas de archivo de los términos de esta taxonomía en el mapa del sitio XML.','Insert custom field (post meta) names which contain image URLs to include them in the sitemaps. Add one per line.'=>'Insertar nombres de campo personalizado (meta de publicación) que contengan URLs de imagen para incluirlas en los mapas del sitio. Añade uno por línea.','Image Custom Fields'=>'Campos personalizados de imagen','Include this post type in the XML sitemap.'=>'Incluir este tipo de contenido en el mapa del sitio XML.','Include in Sitemap'=>'Incluir en mapa del sitio','Add term IDs, separated by comma. This option is applied for all taxonomies.'=>'Añadir IDs de términos separados por comas. Esta opción se aplica a todas las taxonomías.','Exclude Terms'=>'Excluir términos','Enter post IDs of posts you want to exclude from the sitemap, separated by commas. This option **applies** to all posts types including posts, pages, and custom post types.'=>'Introduce la ID de las publicaciones que deseas excluir del mapa del sitio separadas por comas. Esta opción **se aplica** a todos los contenidos, incluidas las publicaciones, páginas y tipos de contenido personalizado.','Exclude Posts'=>'Excluir entradas','Include the Featured Image too, even if it does not appear directly in the post content.'=>'Incluir también la imagen destacada, incluso si esta no aparece directamente en el contenido de la publicación.','Include Featured Images'=>'Incluir imágenes destacadas','Include reference to images from the post content in sitemaps. This helps search engines index the important images on your pages.'=>'Incluir la referencia a imágenes del contenido de la publicación en los mapas del sitio. Esto ayuda a los motores de búsqueda a indexar las imágenes importantes de tus páginas.','Images in Sitemaps'=>'Imágenes en los mapas del sitio','Max number of links on each sitemap page.'=>'Número máximo de enlaces en cada página de mapa del sitio.','Links Per Sitemap'=>'Enlaces por mapa del sitio','Add user IDs, separated by commas, to exclude them from the sitemap.'=>'Añadir IDs de usuario separados por comas para excluirlos del mapa del sitio.','Exclude Users'=>'Excluir usuarios','Exclude User Roles'=>'Excluir perfiles de usuario','XML Sitemap %1$s %2$s'=>'Mapa del sitio XML %1$s %2$s','Rank Math has detected new post types: %1$s. You may want to check the settings of the <a href="%2$s">Titles &amp; Meta page</a> and <a href="%3$s">the Sitemap</a>.'=>'Hemos detectado nuevo(s) tipo(s) de contenido %1$s, quizás querrías comprobar los ajustes de la <a href="%2$s">página de títulos y meta</a> y del <a href="%3$s">mapa del sitio</a>.','%s archives'=>'%s archivos','your product %s pages'=>'tus páginas de producto %s','Taxonomies:'=>'Taxonomías:','Please note that this will add the attachment page URLs to the sitemap, not direct image URLs.'=>'Por favor ten en cuenta que esto añadirá las URL de las páginas de adjuntos al mapa del sitio, no las URL directas de las imágenes.','Sitemap URL: %s'=>'URL del mapa del sitio: %s','single %s'=>'simple %s','your product pages'=>'tus páginas de producto','attachments'=>'adjuntos','Set the sitemap options for author archive pages. %s.'=>'Establece las opciones del mapa del sitio para las páginas de archivo de autor. %s.','This tab contains General settings related to the XML sitemaps.'=>'Esta pestaña contiene los ajustes generales relacionados con los mapas del sitio XML.','No sitemaps found.'=>'No se han encontrado mapas del sitio.','Your site has one or more sitemaps.'=>'Tu sitio tiene uno o más mapas del sitio.','+%d More...'=>'+%d más...','There are %s published posts where the primary focus keyword does not appear in the post title.'=>'Hay %s entradas publicadas en las que la palabra clave objetivo no aparece en el título de la entrada.','Focus keywords appear in the titles of published posts where it is set.'=>'Las palabras clave objetivo aparecen en los títulos de las publicaciones publicadas en las que esta está establecida.','There are %s with no focus keyword set.'=>'Hay %s en las que no se ha establecido la palabra clave principal.','All published posts have focus keywords set.'=>'Todas las publicaciones publicadas tienen las palabras clave objetivo establecidas.','You have not linked Google Search Console yet.'=>'Aún no has enlazado con la Search Console de Google.','Google Search Console has been linked.'=>'Enlazado con la Search Console de Google.','Post permalink structure is set to %s.'=>'La estructura del enlace permanente de la publicación está establecida como %s.','Permalinks are set to a custom structure but the post titles do not appear in the permalinks.'=>'Los enlaces permanentes tienen establecida una estructura personalizada pero los títulos de la publicación no aparecen en los mismos.','Permalinks are set to the default value. <em>Pretty permalinks</em> are disabled. '=>'Los enlaces permanentes están configurados a su valor por defecto. <em>Los enlaces permanentes bonitos</em> están desactivados.','Your Site Tagline is set to a custom value.'=>'La descripción corta de tu sitio está establecida en un valor personalizado.','Your Site Tagline is set to the default value <em>Just another WordPress site</em>.'=>'La descripción corta de tu sitio está establecida en su valor por defecto <em>Simplemente otro sitio WordPress</em>.','If you don\'t have an XML sitemap, the best option is to install a plugin that creates sitemaps for you. That way you\'ll know the sitemap will always be up-to-date. Plugins can also automatically ping the search engines when the XML file is updated. The Rank Math WordPress plugin gives you complete control over your site\'s XML sitemaps. You can control the settings for each page as you write or edit it, and Rank Math will ping Google as soon as you submit your edits. This results in fast crawls and indexing.'=>'Si no tienes un mapa del sitio XML, la mejor opción es instalar un plugin que cree mapas del sitio por ti. De esta manera sabrás que el mapa del sitio siempre estará actualizado. Los plugins también pueden hacer ping automáticamente a los motores de búsqueda cuando se actualiza el archivo XML. El plugin Rank Math para WordPress te proporciona un control total sobre los mapas del sitio XML de tu sitio. Puedes controlar los ajustes para cada página mientras la escribes o editas y Rank Math hará ping a Google tan pronto como envíes tus cambios. Esto se traduce en un rápido rastreo e indexación.','XML sitemaps are a special type of text file that tells search engines about the structure of your site. They\'re a list of all the resources (pages and files) you would like the search engine to index. You can assign different priorities, so certain pages will be crawled first. Before XML sitemaps, search engines were limited to indexing the content they could find by following links. That\'s still an important feature for search engine spiders, but XML sitemaps have made it easier for content creators and search engines to collaborate.'=>'Los mapas del sitio XML son un tipo especial de archivo de texto que indica a los motores de búsqueda cómo es la estructura de tu sitio. Son un listado de todos los recursos (páginas y archivos) que te gustaría que los motores de búsqueda indexasen. Puedes asignar diferentes prioridades para que ciertas páginas sean rastreadas primero. Antes de los mapas del sitio XML, los motores de búsqueda se limitaban a indexar el contenido que podían encontrar siguiendo los enlaces. Eso sigue siendo una característica importante para los motores de búsqueda, pero los mapas de sitio XML han hecho más fácil la colaboración entre los creadores de contenido y los motores de búsqueda.','Read <a href="%1$s" target="_blank">this article</a> for detailed instructions on setting up your Google Webmaster account and getting Rank Math to work with the Google Search Console.'=>'Lee <a href="%1$s" target="_blank">este artículo</a> para obtener instrucciones detalladas de cómo configurar tu cuenta de Google Webmaster y hacer que Rank Math trabaje con Google Search Console.','You can integrate the Google Search Console with Rank math in the <a href="%1$s" target="_blank">Search Console tab</a>. of Rank Math\'s General Settings menu.'=>'Puedes integrar Google Search Console con Rank Math en la <a href="%1$s" target="_blank">pestaña Search Console</a>. del menú de ajustes generales de Rank Math.','Google\'s Search Console is a vital source of information concerning your rankings and click-through rates.  Rank Math can import this data, so you don\'t have to log into your Google account to get the data you need.'=>'Google Search Console es una fuente vital de información sobre tu posicionamiento y porcentaje de clics. Rank Math puede importar estos datos y así no necesitarás iniciar sesión en tu cuenta de Google para acceder a los datos que necesites.','Register at Google Search Console and verificate your site by adding the code to <a href="%1$s">Settings &gt; Verificate Tools</a>, then navigate to <a href="%2$s">Settings &gt; Search Console</a> to authenticate and link your site.'=>'Regístrate en Google Search Console y verifica tu sitio añadiendo el código a <a href="%1$s">Ajustes &gt; Herramientas de verificación</a>, luego ve a <a href="%2$s">Ajustes &gt; Search Console</a> para autorizar y enlazar tu sitio.','Fixing the issue is simple - just edit the post/page and add the focus keyword(s) to the title.'=>'Arreglar este problema es fácil - simplemente edita la publicación/página y añade la o las palabras clave objetivo al título.','HTML Page Titles play a large role in Google\'s ranking algorithm.  When you add a Focus Keyword to a post or page, Rank Math will check to see that you used the keyword in the title.  If it finds any posts or pages that are missing the keyword in the title, it will tell you here.'=>'Los títulos de las páginas HTML juegan un papel importante en el algoritmo de posicionamiento de Google. Cuando añades una palabra clave objetivo a una publicación o página, Rank Math comprobará si has usado la palabra clave en el título. Si encuentras alguna publicación o página a la que le falte la palabra clave en el título, te lo indicará aquí.','Make sure the focus keywords you set for the posts appear in their titles.'=>'Asegúrate que las palabras clave objetivo que establezcas en las publicaciones aparezcan en sus títulos.','Post Titles Missing Focus Keywords'=>'Títulos de la entrada sin palabras clave objetivo','Fixing this issue is easy - just edit the post, and set a Focus Keyword.  Then follow Rank Math\'s analysis to improve your rankings.'=>'Arreglar este problema es fácil - simplemente edita la publicación y establece una palabra clave objetivo. Luego sigue las indicaciones del análisis de Rank Math para mejorar tu posicionamiento.','Of course, if you don\'t give Rank Math a focus keyword to work with, it can\'t give you any useful feedback.'=>'Por supuesto, si no le indicas a Rank Math una palabra clave principal con la que trabajar, este no podrá facilitarte ninguna información útil.','Rank Math uses these focus keywords to analyze your on-page content.  It can tell if you\'ve done a good job of optimizing your text to rank for these keywords.'=>'Rank Math usa estas palabras clave objetivo para analizar el contenido de tu página. Puede indicarte si has hecho un buen trabajo optimizando tu texto para posicionar para estas palabras clave.','Rank Math allows you to set a focus keyword for every post and page you write - the option is in the "Meta Box", which appears under the text editor in the screen where you write and edit content.'=>'Rank Math the permite establecer una palabra clave objetivo para cada publicación y página que escribas - la opción se encuentra en la «Caja meta» que aparece bajo el editor de texto en la pantalla en la que escribes y editas contenido.','Setting focus keywords for your posts allows Rank Math to analyse the content.'=>'Establecer palabras clave objetivo en tus entradas permite a Rank Math analizar el contenido.','Focus Keywords'=>'Palabras clave principales','This looks nice for readers - and it gets your keywords into the URL (keywords in the URL is a ranking factor).'=>'Esto tiene buena pinta para los lectores - y coloca tus palabras clave en la URL (las palabras clave en la URL son un factor de posicionamiento).','This option will replace the "?p=99" part of the URL with the post\'s title, like this: http://www.yoursite.com/my-amazing-post-title/'=>'Esta opción sustituirá la parte "?p=99" de la URL por el título de la publicación, como: http://www.tusitio.com/titulo-de-mi-entrada-increible/','Fortunately, it\'s very easy to fix.  Just hop on over to <a target="_blank" href="%1$s">Settings - Permalinks</a>.  Then chose the "Post Name" option.'=>'Afortunadamente, es muy fácil de arreglar. Simplemente ve a <a target="_blank" href="%1$s">Ajustes - Enlaces permanentes</a>. Y luego elige la opción «Nombre de la entrada».','It\'s not very kind on the eyes, and it does nothing for your site\'s SEO.  In fact, it can hurt it - Google\'s bot is quite cautious about crawling pages that look auto-generated.'=>'No es muy agradable a la vista y no mejora en nada el SEO de tu sitio. De hecho, puede perjudicarlo. Google bot es muy cauteloso a la hora de rastrear páginas que parecen generadas automáticamente.','The standard permalink structure is pretty ugly - WordPress generates offputting URLs like: http://www.yoursite.com/?p=99'=>'La estructura por defecto de los enlaces permanentes es bastante fea. WordPress genera direcciones URL poco atractivas tales como: http://www.tusitio.com/?p=99','For the best SEO results, use a custom permalink structure, preferably one that includes the post title (<code>%%postname%%</code>). You can change it by navigating to <a href="%s">Settings &gt; Permalinks</a>'=>'Para los mejores resultados SEO, usa una estructura de enlace permanente personalizada, preferiblemente una que incluya el título de la publicación (<code>%%postname%%</code>). Puedes cambiar esto yendo a <a href="%s">Ajustes &gt; Enlaces permanentes</a>','Permalink Structure'=>'Estructura de los enlaces permanentes','The tagline is the second option.  Choose a tagline that summarizes your site in a few words.  The tagline is also a good place to use your main keyword.'=>'La descripción corta es la segunda opción. Elige una descripción corta que resuma tu sitio en pocas palabras. La descripción corta es también un buen lugar para usar tu palabra clave principal.','Changing your tagline is very easy.  Just head on over to <a target="_blank" href="%1$s">Settings - General</a> in WordPress\'s admin menu (on the left), or click on the link in this sentence.'=>'Cambiar tu descripción corta es muy fácil. Simplemente ve a <a target="_blank" href="%1$s">Ajustes - General</a> in el menú de administración de WordPress (a la izquierda), o haz clic en el enlace anterior.','Unfortunately, the standard WordPress tagline is "Just Another WordPress site."  That\'s pretty sloppy looking, and it does nothing for your SEO.  In fact, it\'s actually a security risk - it makes it easy for hackers with a WordPress exploit to locate your site with an automated search.'=>'Desafortunadamente, la descripción corta estándar de WordPress es «Simplemente otro sitio de WordPress». Esto es bastante descuidado y no ayuda en nada a tu SEO. De hecho, en realidad en un riesgo para la seguridad: facilita a los hackers con un exploit de WordPress localizar tu sitio con una búsqueda automática.','Most WordPress themes place your site\'s tagline in a prominent position (inside header tags near the top of the page).  Using the right tagline can give your site an SEO boost.'=>'La mayoría de los temas de WordPress colocan la descripción corta de tu sitio en una posición destacada (dentro de las etiquetas de la cabecera cerca de la parte superior de la página). Usar la descripción corta adecuada puede darle a tu sitio un impulso SEO.','Your theme may display the Site Tagline, and it can also be used in SEO titles &amp; descriptions. Set it to something unique. You can change it by navigating to <a href="%s">Settings &gt; General</a>.'=>'Tu tema puede mostrar la descripción corta del sitio, y esta puede ser también usada en los títulos SEO y descripciones. Usa algo único para la misma. Puedes cambiarla navegando a <a href="%s">Ajustes &gt; General</a>.','Site Tagline'=>'Descripción corta del sitio','OK'=>'OK','SEO Score'=>'Puntuación SEO','SEO Analysis for this page'=>'Análisis SEO para esta página','Analyze this Page'=>'Analizar esta página','Site-wide analysis'=>'Análisis de todo el sitio','Size: %s'=>'Tamaño: %s','Data Rows: %s'=>'Filas de datos: %s','Fetching in Progress'=>'Recuperación en curso','Update data manually'=>'Actualizar los datos manualmente','Items'=>'Elementos','Google oAuth is not authorized.'=>'Google oAuth no está autorizado.','Not a valid settings founds to delete cache.'=>'No se han encontrado ajustes válidos para borrar la caché.','Average Position'=>'Posición media','Total Impressions'=>'Impresiones totales','Total Clicks'=>'Clics totales','Total Keywords'=>'Palabras clave totales','Not found'=>'No encontrado','Response Code'=>'Código de re