st here.'=>'Las redirecciones 301 son <em>permanentes</em>. La antigua URL será eliminada en los motores de búsqueda y reemplazada por la nueva, pasando a SearchRank y otras puntuaciones de SEO. Los navegadores también pueden almacenar la nueva URL en la caché y redirigirla incluso después de eliminar la redirección de la lista aquí.','Here you can set up custom redirections. It is important to choose the right type of redirection.'=>'Aquí puedes establecer redirecciones personalizadas. Es importante elegir el tipo adecuado de redirección.','You can also activate, deactivate, or delete multiple items at once using the Bulk Actions dropdown.'=>'También puedes activar, desactivar o borrar múltiples elementos a la vez usando el desplegable de acciones en lote.','<strong>Delete</strong> permanently removes the redirection.'=>'<strong>Borrar</strong> elimina permanentemente la redirección.','<strong>Activate/Deactivate</strong> redirections. Deactivated redirections do not take effect on your site.'=>'<strong>Activar/Desactivar</strong> redirecciones. Las redirecciones desactivadas no tienen efecto en tu sitio.','<strong>Edit</strong> redirection details: from/to URLs and the redirection type.'=>'<strong>Editar</strong> los detalles de la redirección: URLs desde/hacia y tipo de redirección.','<strong>Note:</strong> This interstitial page is displayed only to administrators. Site visitors are redirected without delay.'=>'<strong>Nota:</strong> Esta página intersticial se muestra solo a los administradores. Las visitas del sitio se redirigen sin demora.','Manage All Redirections'=>'Gestionar todas las redirecciones','Manage This Redirection'=>'Gestionar esta redirección','Continue redirecting'=>'Continuar redireccionando','Stop Redirection'=>'Parar redirección','Redirecting in %s seconds...'=>'Redireccionando en %s segundos...',' To '=>'Para','Redirecting from '=>'Redireccionando desde','Redirection Debugger'=>'Depurador de redireccionamiento','<strong>SEO Notice:</strong>