ter a question mark in a URL) when logging 404 errors.'=>'Activar para ignorar todos los parámetros de consulta (la parte después de un signo de interrogación en una URL) al registrar errores 404.','Ignore Query Parameters'=>'Ignorar parámetros de consulta','Remove'=>'Eliminar','Add another'=>'Añadir otro','Enter URIs or keywords you wish to prevent from getting logged by the 404 monitor.'=>'Introduce URIs o palabras clave que desees evitar que sean registradas por el monitor 404.','Exclude Paths'=>'Excluir rutas','Sets the max number of rows in a log. Set to 0 to disable the limit.'=>'Establece el número máximo de filas en un registro. Establecer a 0 para desactivar el límite.','Log Limit'=>'Límite del registro','Simple'=>'Simple','The Simple mode only logs URI and access time, while the Advanced mode creates detailed logs including additional information such as the Referer URL.'=>'El modo simple solamente registra URI y tiempo de acceso, mientras que el modo avanzado crea registros detallados que incluyen información adicional como la URL del remitente.','Mode'=>'Modo','If you have hundreds of 404 errors, your error log might increase quickly. Only choose this option if you have a very few 404s and are unable to replicate the 404 error on a particular URL from your end.'=>'Si tienes cientos de errores 404, tu registro de errores puede incrementarse rápidamente. Elige esta opción solamente si tienes pocos 404 y eres incapaz de replicar el error 404 de una URL particular desde tu terminal.','You can reorder the list by clicking on the column headings. '=>'Puedes reordenar la lista haciendo clic en los encabezados de las columnas.','You can search items using the search form at the top.'=>'Puedes buscar elementos usando el formulario de búsqueda de la parte superior.','You can decide how many items to list per screen using the Screen Options tab.'=>'Puedes decidir cuántos elementos se listan por pantalla usando la pestaña de opciones de pantalla.','You can hide/display columns based on your needs.'=>'Puedes ocultar/mostrar columnas según tus necesidades.','You can customize the display of this screen\'s contents in a number of ways:'=>'Puedes personalizar la visualización del contenido de esta pantalla de varias maneras:','You can also redirect or delete multiple items at once. Selecting multiple items to redirect allows you to redirect them to a single URL.'=>'Puedes redireccionar o borrar múltiples elementos a la vez. Seleccionar múltiples elementos para redireccionar te permite redireccionarlos todos a una sola URL.','<strong>Delete</strong> permanently removes the item from the list.'=>'<strong>Borrar</strong> elimina para siempre el elemento de la lista.','<strong>Redirect</strong> takes you to the Redirections manager to redirect the 404 URL.'=>'<strong>Redireccionar</strong> te lleva al gestor de redirecciones para redireccionar la URL del error 404.','<strong>View Details</strong> shows details about the 404 requests.'=>'<strong>Ver detalles</strong> muestra detalles sobre las solicitudes 404.','Hovering over a row in the list will display action links that allow you to manage the item. You can perform the following actions:'=>'Al pasar el cursor sobre una fila de la lista, se mostrarán los enlaces que te permiten gestionar el elemento. Puedes realizar las siguientes acciones:','Access Time'=>'Tiempo de acceso','Hits'=>'Impactos','User-Agent'=>'Agente de usuario','Referer'=>'Referente','URI'=>'URI','Redirect'=>'Redirigir','View Redirection'=>'Ver redirección','Clear Log'=>'Limpiar el registro','The 404 error log is empty.'=>'El registro de errores 404 está vacío.','Log item successfully deleted.'=>'Elemento del registro borrado correctamente.','No valid id found.'=>'No se ha encontrado una id válida.','Review 404 errors on your site'=>'Revisar los errores 404 en tu sitio','Are you sure you wish to delete all 404 error logs?'=>'¿Estás seguro de querer borrar todos los registros de errores 404?','Bulk Actions'=>'Acciones